import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { format } from 'date-fns';

const Reports = () => {
  const [startDate, setStartDate] = useState(format(new Date(), 'yyyy-MM-dd'));
  const [endDate, setEndDate] = useState(format(new Date(), 'yyyy-MM-dd'));
  const [reportData, setReportData] = useState([]);
  const [totalEmissions, setTotalEmissions] = useState(0);

  const fetchReportData = useCallback(async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/data');
      const data = response.data;

      const filteredData = data.filter(entry => {
        const entryDate = new Date(entry.date);
        return (
          entryDate >= new Date(startDate) &&
          entryDate <= new Date(endDate)
        );
      });

      setReportData(filteredData);

      const total = filteredData.reduce((acc, curr) => acc + parseFloat(curr.emissions), 0);
      setTotalEmissions(total.toFixed(2));
    } catch (error) {
      console.error('Error fetching report data:', error);
    }
  }, [startDate, endDate]);

  useEffect(() => {
    fetchReportData();
  }, [fetchReportData]);

  return (
    <div className="main-content px-6 py-4">
      <h2 className="text-2xl font-bold mb-4">Carbon Footprint Report</h2>

      <div className="flex gap-4 mb-6">
        <div>
          <label className="block text-sm font-medium">Start Date:</label>
          <input
            type="date"
            value={startDate}
            onChange={e => setStartDate(e.target.value)}
            className="border p-2 rounded"
          />
        </div>
        <div>
          <label className="block text-sm font-medium">End Date:</label>
          <input
            type="date"
            value={endDate}
            onChange={e => setEndDate(e.target.value)}
            className="border p-2 rounded"
          />
        </div>
      </div>

      <div className="bg-white shadow-md rounded p-6 mb-6">
        <h3 className="text-xl font-semibold mb-2">Total Emissions</h3>
        <p className="text-3xl font-bold text-green-600">{totalEmissions} kg CO2</p>
        <p className="text-sm text-gray-500">
          Period: {format(new Date(startDate), 'M/d/yyyy')} - {format(new Date(endDate), 'M/d/yyyy')}
        </p>
      </div>

      <div className="bg-white shadow-md rounded p-6">
        <h3 className="text-xl font-semibold mb-4">Detailed Activities</h3>
        <table className="w-full table-auto border-collapse">
          <thead>
            <tr className="bg-gray-100">
              <th className="border px-4 py-2">Date</th>
              <th className="border px-4 py-2">Type</th>
              <th className="border px-4 py-2">Description</th>
              <th className="border px-4 py-2">Emissions (kg CO2)</th>
            </tr>
          </thead>
          <tbody>
            {reportData.map((entry, index) => (
              <tr key={index}>
                <td className="border px-4 py-2">{format(new Date(entry.date), 'M/d/yyyy')}</td>
                <td className="border px-4 py-2">{entry.type}</td>
                <td className="border px-4 py-2">{entry.description}</td>
                <td className="border px-4 py-2">{entry.emissions}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Reports;
